 I'm using typeorm with postgres and I want to store json in my entity. How can I do that?

## Answer (1)

You can use `json` or `jsonb` type in PostgreSQL. In TypeORM you can use `JsonObject` or `JsonArray` types.

```
@Entity()
export class MyEntity {
  @Column('json')
  myJson: JsonObject;
}
```

