  "style": {
    "backgroundColor": "red"
  }
}
```

## Answer (1)

You can use the `backgroundColor` property of the `style` object to change the background color of the adaptive card. Here is an example:

```
{
  "type": "AdaptiveCard",
  "body": [
    {
      "type": "TextBlock",
      "text": "Hello, world!"
    }
  ],
  "style": {
    "backgroundColor": "#FF0000"
  }
}
```

In this example, the background color of the adaptive card is set to red. You can use any valid CSS color value for the `backgroundColor` property.

